import '../../assets/css/Dashboard.css';
import logo from '../../assets/img/LogoBig.png';

import Card from 'react-bootstrap/Card'


class DatabaseInfo extends React.Component{

  render(){
    return(
      <Card>
        <Card.Header>Info de la BBDD</Card.Header>
        <Card.Body>
          <blockquote className="blockquote mb-0">
            <p>
              {' '}
              Lorem ipsum dolor sit amet, consectetur adipiscing elit. Integer posuere
              erat a ante.{' '}
            </p>
            <footer className="blockquote-footer">
              Someone famous in <cite title="Source Title">Source Title</cite>
            </footer>
          </blockquote>
        </Card.Body>
      </Card>
    )
  }

}

class CardsInfor extends React.Component{
  render(){
    return(
      <div class="card flex-row flex-wrap" id='web_info_card'>
          <div class="card-header border-0">
              <img src={logo} alt=""/>
          </div>
          <div class="card-block px-2">
              <h4 class="card-title">Title</h4>
              <p class="card-text">Description</p>
              <a href="#" class="btn btn-primary">BUTTON</a>
          </div>
          <div class="w-100"></div>
      </div>
    )
  }
}

export {CardsInfor,DatabaseInfo};
